import React from 'react'
import './home.css'
export default function Home() {
  const getcaretaker=async()
  return (
    <div className='container'>
        <div className='block1' onClick={()=>getdoctor()}>
          <h3>DOCTOR</h3>
            
        </div>
        <div className='block2'onClick={()=>getcaretaker()}>
          <h3>CARE TAKER</h3>
        </div>
      
    </div>
  )
}
